Synopsis:


The tale of Conan the Cimmerian and his adventures across the continent of Hyboria on a quest to avenge the murder of his father and the slaughter of his village.
During the Hyborean Age, a group of sorcerers from Acheron created a mask from the skulls of dead kings and sacrificed their pure blood daughters to the dark gods in order to give the mask the power to subjugate the entire world. After killing countless people in their campaign to conquer the planet, the sorcerers were defeated by the Cimmerians led by Corin (Ron Perlman), who destroys the mask, scattering the pieces across the land, and keeping one for himself.
Years later, the Cimmerians are at war with a rival clan. Corin's pregnant wife is fatally injured in the battle, but is able to give birth to a son, Conan, before succumbing to her injuries. Conan's birth on a battlefield, and subsequent survival, is considered to be a powerful omen.

